const API_BASE_URL = `http://localhost:3000`;

const headers = {
  "Content-Type": "application/json",
  Accepts: "application/json"
};

getFunkos = () => {
  fetch(`${API_BASE_URL}/funkos`).then(res => res.json());
};

export default {
  getFunkos
};
